import { useEffect, useState } from 'react'

const BtnStyle = () => {

  const [active ,setActive ] = useState('light')







  return (
    <div className="style-box">
        <div className={`light-box ${active === "light" ? 'style-selected':''}`}>
            <img src="../../../img/icons/light.svg" alt="Ligth Style" />
        </div>
        <div className={`dark-box ${active === "dark" ? 'style-selected':''}`}>
            <img src="../../../img/icons/dark.svg" alt="Dark Style" />
        </div>
    </div>
  )
}

export default BtnStyle
